import React from "react";
import { Dish } from "../Dish/Dish";

export const Menu = ({ menu }) => {
  if (!menu?.length) {
    return <span>Пусто тут</span>;
  }

  return (
    <div>
      <h2>Menu</h2>
      <div>
        {menu.map(({ name }) => (
          <Dish name={name} default={0} />
        ))}
      </div>
    </div>
  );
};
